result:
.move-enter-active,
.move-leave-active {
  transition: all 0.2s linear;
  transform: translateY(0%);
}
.move-enter,
.move-leave {
  transform: translateY(-10px);
}
.move-leave-to {
  transform: translateY(-10px);
  color: #00b8af;
}
.v-input__slider >>> .v-slider__tick {
  background-color: #f7f7f7;
  border-radius: 50%;
}
.v-input__slider >>> .v-slider__tick--filled {
  background-color: var(--theme);
}
.v-input__slider >>> .v-slider__thumb {
  height: 20px;
  width: 20px;
  background: var(--urlControl) !important;
}
.v-input__slider >>> .v-slider__thumb::before {
  opacity: 0;
}
.form-content {
  border-radius: 16px;
}
textarea {
  border-radius: 1vh;
  outline: none;
  resize: none;
  overflow: hidden;
}
.show-seed {
  display: flex;
  align-items: center;
  text-align: center;
  min-height: 20vh;
  border-radius: 1vh;
}
.v-dialog__content {
  display: flex;
  align-items: flex-end;
}
.v-dialog__content >>> .v-dialog--active {
  margin: 0;
  height: 100%;
}
.v-text-field >>> .v-label {
  font-family: "SFProText-Regular", "SFProText", "SF Pro Text Regular";
  font-weight: 400;
  font-size: 15px;
  color: #9e9e9e;
  max-width: 100%;
}
